{"Link": "https://caritas.gr/activities-gr/dorean-diadiktyaki-psychologiki-ypostirixi-stoys-katoikoys-ton-nision/", "Location": "38.3726478 26.1295579", "Απευθύνεται": "Σε κατοίκους των νήσων Β. Αιγαίου", "Περιγραφή": "Δωρεάν υπηρεσίες στήριξης μέσω τηλεδιάσκεψης για την αντιμετώπιση των ψυχολογικών συνεπειών της πανδημίας στον πληθυσμό που διαμένει στα νησιά του Β. Αιγαίου για τους επόμενους 2 μήνες. 

Η υπηρεσία λειτουργεί καθημερινά από Δευτέρα έως Παρασκευή 10.00 – 15.00 και στελεχώνεται από ψυχολόγο εξειδικευμένη σε θέματα διαχείρισης άγχους. Οι ενδιαφερόμενοι μπορούν να επικοινωνούν ώστε να προγραμματίσουν ραντεβού με το ειδικά στελεχωμένο προσωπικό της Caritas Hellas είτε με email στο caritas-helpline@caritas.gr είτε με μήνυμα μέσω του προσωπικού λογαριασμού στο Skype στην γραμμή βοήθειας Caritas Hellas Helpline. 

H υπηρεσία προσφέρεται στις παρακάτω γλώσσες: Ελληνικά, Αγγλικά, Γαλλικά, Φαρσί, Αραβικά.", "Φορέας": "Caritas Hellas"}

{"Link": "https://www.facebook.com/group.process.team", "Location": "37.976809 23.752436 0 0", "Απευθύνεται": "Σε όποιον έχει ανάγκη ψυχολογικής στήριξης", "Περιγραφή": "Δωρεάν θεραπείες Gelstat. Συγκεκριμένα, ξεκίνησαν ήδη, μια καινούρια τηλεφωνική και διαδικτυακή πρακτική, προσφέροντας εθελοντικά, συνεδρίες συμβουλευτικής και ψυχολογικής στήριξης Gestalt, μέσω Skype, Messenger, Viber, WhatsApp ή ακόμα και τηλεφωνικά, σε όποιον τις έχει πραγματικά ανάγκη.

Οι δωρεάν συνεδρίες Gelstat θα έχουν συγκεκριμένη διάρκεια και περιοδικότητα, ενώ θα ακολουθούν τις αρχές και τον κώδικα δεοντολογίας των συμβούλων ψυχικής υγείας  και ψυχοθεραπευτών Gestalt.

Αν λοιπόν η κατάσταση που ζούμε σας πιέζει, σας αγχώνει και κλονίζει την ψυχική σας υγεία, μην διστάσετε! Επικοινωνήστε μαζί τους μέσα από το link που ακολουθεί.", "Φορέας": "Gelstat Foundation"}
